function check_element(e){var t=document.getElementsByTagName("*"),n=(t.length,100/t.length);if(jQuery(e).on()){var a=n+Number(document.getElementById("progress_width").value);document.getElementById("progress_width").value=a,jQuery("#bar1").animate({width:a+"%"},10,(function(){"100%"==document.getElementById("bar1").style.width&&jQuery(".progress").fadeOut("slow")}))}else set_ele(e)}function set_ele(e){check_element(e)}document.onreadystatechange=function(e){if("interactive"==document.readyState)for(var t=document.getElementsByTagName("*"),n=0,a=t.length;n<a;n++)set_ele(t[n])};